import React from 'react';
import './Playlist.css';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Tracklist from '../TrackList/TrackList';
import Paper from '@mui/material/Paper';
import Typography from '@mui/material/Typography'; // Ensure Typography is imported

function Playlist() {
  return (
    <Paper className="playlist" elevation={0} sx={{ backgroundColor: 'rgba(255, 255, 255, 0.3)' }}>
      <Typography variant="h5" component="h2" gutterBottom sx={{ color: 'white' }}>
        My Playlist
      </Typography>
      <Tracklist />
      <TextField 
        fullWidth 
        size="small" 
        label="New Playlist" 
        variant="outlined" 
        sx={{ marginBottom: 2, backgroundColor: 'rgba(255, 255, 255, 0.3)' }}
      />
      <Button 
        variant="contained" 
        color="primary"
        sx={{ marginY: 2 }}
      >
        SAVE TO SPOTIFY
      </Button>
    </Paper>
  );
}

export default Playlist;
